const signupform = () => {
    return (
        <div>
            <form action="">
                <label >Display Name</label>
                <input type="text" />

                <label >Email</label>
                <input type="email" />

                <label >Password</label>
                <input type="password" />

                <label >Confirm Password</label>
                <input type="password" />


            </form>
        </div>
    );
}
export default signupform;
